import React, { Component } from "react";
import { Container, Col, Row} from "react-bootstrap";
import "bootstrap/dist/css/bootstrap.min.css";
import { Route,NavLink,BrowserRouter as Router,Switch} from "react-router-dom";
import Me from "./Me";
import Article from "../dashboard/Article";
import Notfound from "../dashboard/Notfound";
import Home from "../dashboard/Home";
import Upload from "../dashboard/Upload";
import Newarticle from "../dashboard/Newarticle";
import EditPost from "../dashboard/EditPost";
import DetailExcercise from "../dashboard/detailExcercise";



class Navbar extends Component {
    render() {
      return (


        <Router>

          <Switch>

               <Route exact path="/dashboard/home" component={(props) => <Home  />} />
               <Route  path="/dashboard/me" component={(props) => <Me  />} />
               <Route path="/dashboard/post" component={(props) => <Upload  />} />
               <Route path="/dashboard/article" component={(props) => <Article  />} />
               <Route path="/dashboard/:id" render={(props)=> <Newarticle {...props} />} />
               <Route path="/dashboard/:id" render={(props)=> <DetailExcercise {...props} />} />
               <Route path="/edit-post/:id" render={(props)=> <EditPost {...props} />} />
               <Route  path="/404" component={Notfound} />
             </Switch>
             <Container>
             <Row>


              <Col>
                  <NavLink  to="/dashboard/home">
                    Home
                  </NavLink>
              </Col>

              <Col>
                  <NavLink  to="/dashboard/article">
                    Article
                  </NavLink>
              </Col>

              <Col> 
                  <NavLink to="/dashboard/me">
                  Me
                  </NavLink>
              </Col> 

              <Col> 
                  <NavLink to="/dashboard/post">
                  Post
                  </NavLink>
              </Col> 



              </Row>
             </Container>
      </Router>


      );
    }
  }

export default Navbar;
